CREATE TABLE `form`
(
    `form_id`     bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
    `name`        varchar(30) COLLATE utf8_bin COMMENT 'name',
    `region`      varchar(30) COLLATE utf8_bin COMMENT 'region',
    `date1`       varchar(10) COLLATE utf8_bin COMMENT 'date1',
    `date2`       varchar(24) COLLATE utf8_bin COMMENT 'date2',
    `delivery`    tinyint(1) COMMENT 'delivery',
    `type`        varchar(30) COLLATE utf8_bin COMMENT 'type',
    `resource`    varchar(30) COLLATE utf8_bin COMMENT 'resource',
    `description` text COLLATE utf8_bin COMMENT 'desc',
    `options`     varchar(30) COLLATE utf8_bin COMMENT 'options',
    PRIMARY KEY (form_id)
) ENGINE = InnoDB
  AUTO_INCREMENT = 1000000000
  DEFAULT CHARSET = utf8
  COLLATE = utf8_bin;

